import React from 'react';

import Nav from 'react-bootstrap/Nav';


function NavBody() {
    return(
            <Nav fill variant="tabs" >
                <Nav.Item>
                    <Nav.Link >Всі</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link >Для волосся</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link ></Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="disabled" > Disabled </Nav.Link>
                </Nav.Item>
            </Nav>
    )

}

export default NavBody;
